import {Layout, Header, Navigation, Drawer, Content} from 'react-mdl'


export class Home extends Component {
  render() {
    return (
      <div>
          <Layout style={{background: 'url(http://www.tipmine.com/uploads/tip/image/7455/MP900408982.JPG) center / cover'}}>
        <Header transparent title="Menu" style={{color: 'white'}}>

        </Header>
        <Drawer title="Menu">

        </Drawer>
        <Content />
    </Layout>
      </div>
    )
  }
}

export default Home
